import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-slate-900 to-purple-900 flex items-center justify-center p-6">
      <div className="bg-white/5 backdrop-blur-xl rounded-3xl p-8 border border-white/10 shadow-2xl max-w-md w-full">
        <h1 className="text-4xl font-bold text-white mb-4 text-center">TAILWIND IS WORKING!</h1>
        <p className="text-white/70 text-center">Dark glass card with blur and gradient.</p>
        <div className="mt-6 p-4 bg-green-500/10 border border-green-500/30 rounded-xl text-green-300 text-sm">
          Success: Tailwind v3 loaded
        </div>
      </div>
    </div>
  );
}

export default App;
